import React from "react";

const ScoreBox = ({ score }) => {
  return (
    <div className="card col-1 col-12-sm">
      <p className="m-2">
        Score:
        <span className="badge bg-primary rounded-pill m-2">{score}</span>
      </p>
    </div>
  );
};

export default ScoreBox;
